sys_variable_value.value:
(function execute(inputs, outputs) {
    var event = inputs.eventId.trim();
    if (event.length == 0) {
        throw "Error while updating Event, invalid inputs have been passed.";
    }
    outputs.calendar_id = inputs.calendarId.trim() || "primary";
    outputs.event_id = event;
})(inputs, outputs);

